import {data} from '../helper/data'
import PlayerCard from "./PlayerCard"

const CardContainer = () => {
    
  return (
    <Container className="card-container rounded-4 my-4 p-3">
        <Row>
            
        </Row>
      {data.map((player)=> <PlayerCard {...player}/>)}
    </Container>
  )
}

export default CardContainer
